import React from 'react';
import Header from './Header';

const layoutStyle = {
    width: '640px',
    margin: '0 auto',
}

function Layout({ children }) {
    return (
        <div
            className="layout"
            style={ layoutStyle }>
            <Header />
            { children }
        </div>
    )
}

export default Layout;
